import { ref } from 'vue';
export default {
  name: "EnableClientSide.vue",
  props: ['modelValue', 'id'],
  watch: {
    selected(curr) {
      this.$emit('update:modelValue', curr);
    },
    modelValue(state) {
      this.selected = state;
    }
  },
  setup(props) {
    const selected = ref(props.modelValue);
    return {
      selected
    };
  }
};
